-- ----------------------------
--  Table structure for `web_environment`
-- ----------------------------
DROP TABLE IF EXISTS `web_environment`;
CREATE TABLE `web_environment` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id 自增',
  `systemId` int(11) DEFAULT NULL COMMENT '所属系统',
  `url` varchar(255) DEFAULT NULL COMMENT '访问页面的url',
  `markUser` varchar(64) DEFAULT NULL COMMENT '统一某一时间段用户标识',
  `markPage` varchar(64) DEFAULT NULL COMMENT '所有资源页面统一标识 html img css js 用户系统信息等',
  `browser` varchar(20) DEFAULT NULL COMMENT '浏览器名称',
  `borwserVersion` varchar(20) DEFAULT NULL COMMENT '浏览器版本',
  `system` varchar(20) DEFAULT NULL COMMENT '操作系统',
  `createTime` datetime DEFAULT NULL COMMENT '用户访问时间',
  `systemVersion` varchar(20) DEFAULT '' COMMENT '系统版本',
  `IP` varchar(20) DEFAULT NULL COMMENT '访问者IP',
  `isp` varchar(20) DEFAULT NULL COMMENT '运营商',
  `county` varchar(20) DEFAULT NULL COMMENT '国家',
  `province` varchar(30) DEFAULT '' COMMENT '省',
  `city` varchar(30) DEFAULT NULL COMMENT '市',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=169 DEFAULT CHARSET=utf8mb4;

